import "./App.css";
import Home from "./Home";
import { useState } from "react";
import Login from "./components/Login";

function App() {
  const [isLogged, setLogged] = useState(false);
  return (
    <div className="App">
      { isLogged ? <Login /> :
      <Home />}
    </div>
  );
}

export default App;
